INSERT INTO `drup_cache_field` VALUES ('field:file:7','a:0:{}',0,1420607737,1),('field:file:9','a:0:{}',0,1420607737,1),('field:node:1','a:2:{s:4:\"body\";a:1:{s:3:\"und\";a:1:{i:0;a:5:{s:5:\"value\";s:3697:\"<h1>About VirtualEmployee.com</h1>\r\n\r\n<h2>Advantages of outsourcing with VE for SMEs</h2>\r\n\r\n<div class=\"check-2 dotted\">\r\n<ul>\r\n	<li>Partnering with VirtualEmployee.com is like having your own branch office in India, just like 50 percent of all 500 Fortune companies who have a strong presence in India.</li>\r\n	<li>A huge talent pool available at competitive cost working for you from your managed office in India – all at zero setup cost.</li>\r\n	<li>Solving problems you face with freelancing and at rates better than freelancing. In the freelancing model, every freelancer usually works remotely from a different location. This creates communication inconvenience between the entire team if the client has hired a virtual team of freelancers who are scattered all over the globe.</li>\r\n	<li>But with VirtualEmployee.com, your entire team sits next to each other in a managed office. This increases the productivity of the team as a whole and makes it easier for the client to manage his/ her projects. The best part? The workforce/ office/ payroll/ hardware/ software are all managed by the VirtualEmployee.com staff.</li>\r\n</ul>\r\n</div>\r\n\r\n<h3>Our Driving Force : Professionalism</h3>\r\n\r\n<p>The driving force behind our rapid success, which today sees us serve more than 3500 companies from 26 countries, is our mindset. VirtualEmployee.com’s mindset is focused solely on professionalism. Professionalism in all areas, be it customer support, HR, recruitment, office hardware, office infrastructure, or management. But, most importantly, professionalism by always staying true to our commitment to quality and cost beliefs.</p>\r\n\r\n<h3>Great combination of technology and human resources</h3>\r\n\r\n<div class=\"onehalf\"><img alt=\"\" src=\"/drupal/sites/default/files/virtualemployee-mission.jpg\" style=\"height:272px; width:410px\" />\r\n<h2>Our Goal</h2>\r\n\r\n<h3>Same Quality at Low Cost</h3>\r\n\r\n<p>VirtualEmployee.com, established in August 2007, has at its core a unique and revolutionary business principle, \'Same quality but significantly lower cost\'. It aims to fulfill the long-standing outsourcing vacuum felt by scores of Small Medium Enterprises (SMEs) across North America and Europe who, till now, were dependent mostly on offshore freelancers. VirtualEmployee.com simplifies their outsourcing experience by providing them with dedicated Indian employees who work exclusively for them just like their own in-house hires. These Indian professionals match their western counterparts in skills, qualifications and experience alongwith the added advantage of attractive low costs. In short, VirtualEmployee.com provides equally (or even more) qualified employees from any domain or profession but at significantly lower costs.</p>\r\n</div>\r\n\r\n<div class=\"onehalf\"><img alt=\"\" src=\"/drupal/sites/default/files/virtualemployee-strengths.jpg\" style=\"height:272px; width:410px\" />\r\n<h2>Our Strengths</h2>\r\n\r\n<h3>Intelligent Use of Technology and Human Resource</h3>\r\n\r\n<p>We provide every client with a dedicated, full-time virtual employee who works remotely for them from our office here in India. To successfully achieve this objective, VirtualEmployee.com relies on management, infrastructure, hardware and the latest technology to bridge physical distance and time zone differences. Although your virtual employee works directly for you, it is VirtualEmployee.com that provides every employee with the latest hardware, infrastructure of international standards and supervision, guidance and management. What this achieves is that even though your employee is working from our office in India, they work directly for you as though they were operating physically from your office.</p>\r\n</div>\r\n\";s:7:\"summary\";s:0:\"\";s:6:\"format\";s:9:\"full_html\";s:10:\"safe_value\";s:3644:\"<h1>About VirtualEmployee.com</h1>\n<h2>Advantages of outsourcing with VE for SMEs</h2>\n<div class=\"check-2 dotted\">\n<ul><li>Partnering with VirtualEmployee.com is like having your own branch office in India, just like 50 percent of all 500 Fortune companies who have a strong presence in India.</li>\n<li>A huge talent pool available at competitive cost working for you from your managed office in India – all at zero setup cost.</li>\n<li>Solving problems you face with freelancing and at rates better than freelancing. In the freelancing model, every freelancer usually works remotely from a different location. This creates communication inconvenience between the entire team if the client has hired a virtual team of freelancers who are scattered all over the globe.</li>\n<li>But with VirtualEmployee.com, your entire team sits next to each other in a managed office. This increases the productivity of the team as a whole and makes it easier for the client to manage his/ her projects. The best part? The workforce/ office/ payroll/ hardware/ software are all managed by the VirtualEmployee.com staff.</li>\n</ul></div>\n<h3>Our Driving Force : Professionalism</h3>\n<p>The driving force behind our rapid success, which today sees us serve more than 3500 companies from 26 countries, is our mindset. VirtualEmployee.com’s mindset is focused solely on professionalism. Professionalism in all areas, be it customer support, HR, recruitment, office hardware, office infrastructure, or management. But, most importantly, professionalism by always staying true to our commitment to quality and cost beliefs.</p>\n<h3>Great combination of technology and human resources</h3>\n<div class=\"onehalf\"><img alt=\"\" src=\"/drupal/sites/default/files/virtualemployee-mission.jpg\" style=\"height:272px; width:410px\" /><h2>Our Goal</h2>\n<h3>Same Quality at Low Cost</h3>\n<p>VirtualEmployee.com, established in August 2007, has at its core a unique and revolutionary business principle, \'Same quality but significantly lower cost\'. It aims to fulfill the long-standing outsourcing vacuum felt by scores of Small Medium Enterprises (SMEs) across North America and Europe who, till now, were dependent mostly on offshore freelancers. VirtualEmployee.com simplifies their outsourcing experience by providing them with dedicated Indian employees who work exclusively for them just like their own in-house hires. These Indian professionals match their western counterparts in skills, qualifications and experience alongwith the added advantage of attractive low costs. In short, VirtualEmployee.com provides equally (or even more) qualified employees from any domain or profession but at significantly lower costs.</p>\n</div>\n<div class=\"onehalf\"><img alt=\"\" src=\"/drupal/sites/default/files/virtualemployee-strengths.jpg\" style=\"height:272px; width:410px\" /><h2>Our Strengths</h2>\n<h3>Intelligent Use of Technology and Human Resource</h3>\n<p>We provide every client with a dedicated, full-time virtual employee who works remotely for them from our office here in India. To successfully achieve this objective, VirtualEmployee.com relies on management, infrastructure, hardware and the latest technology to bridge physical distance and time zone differences. Although your virtual employee works directly for you, it is VirtualEmployee.com that provides every employee with the latest hardware, infrastructure of international standards and supervision, guidance and management. What this achieves is that even though your employee is working from our office in India, they work directly for you as though they were operating physically from your office.</p>\n</div>\n\";s:12:\"safe_summary\";s:0:\"\";}}}s:18:\"field_insert_image\";a:1:{s:3:\"und\";a:2:{i:0;a:14:{s:3:\"fid\";s:1:\"7\";s:3:\"uid\";s:1:\"1\";s:8:\"filename\";s:27:\"virtualemployee-mission.jpg\";s:3:\"uri\";s:36:\"public://virtualemployee-mi